            .then(res=>res.json())
            .then(json=>setCategories(json))}
    ,[])
    return(
        <div className="flex flex-col gap-10 justify-evenly h-full pl-10">
            {categories.map((category)=>{
                console.log(category);
                return (<div >
                    {category}
                    </div>
                )})}
        </div>
)}

export default Categories
